import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="homepage">
      <h1>Welcome to FastSync</h1>
      <p>Your one-stop solution for seamless Folder migrations.</p>
      <p>With FastSync, you can easily manage and validate your migration projects.</p>
    </div>
  );
};

export default HomePage;
